import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Main from './components/Main';
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/home' element={<Main/>}/>
      <Route path='/' element={<Home/>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
